            "profileText": "Mark Chaknos is a local and national award winning Real Estate Broker and Berks County native. A graduate of Governor Mifflin and the Pennsylvania State University, Mark has excelled in becoming one of the most successful real estate agents in our area since joining the industry in 2011. Currently ranked in the Top 25 of both units sold and overall sales production among all Century 21 Realtor's in the State of Pennsylvania, Mark is driven towards becoming #1.\r\nReal estate has always been a part of his life, as his father co-founded Century 21 Park Road almost 40 years ago. Since joining the brokerage in 2011, Mark has helped hundreds of clients purchase or sell a home. His devotion and unparalleled customer service has resulted in a continuously expanding network of loyal clients and referrals. In real estate, Mark is committed to staying ahead of the game when it comes to market education, trends, and technology. Buyers and sellers alike will say that he is connected, straight forward and dedicated to providing the very best service.\r\nMark also enjoys working within the greater Reading-Berks community, co-chairing an event with the Reading Public Library in their fundraising efforts. His involvement in community service also includes Alvernia's Leadership Berks program, the Greater Reading Young Professionals Group, and more recently participating in the Olivet's Boys and Girls Club fundraising campaign. Another important aspect of his career is his involvement in relocation services, specifically with physicians coming into the Berks County area for the first time. Mark's mission has and will always be to provide a positive home buying or selling experience to his clients.",
            "htmlProfileText": "<p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255); line-height: 1.8; margin-top: 0pt; margin-bottom: 17pt;\"><span style=\"font-size: 11.5pt; font-family: Verdana; color: rgb(68, 68, 68); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Mark Chaknos is a local and national award winning Real Estate Broker and Berks County native.&nbsp;A graduate of Governor Mifflin and the Pennsylvania State University, Mark has excelled in becoming one of the most successful real estate agents in our area since joining the industry in 2011.&nbsp; Currently ranked in the Top 25 of both units sold and overall sales production among all Century 21 Realtor's in the State of Pennsylvania, Mark is driven towards becoming #1.</span></p><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255); line-height: 1.8; margin-top: 0pt; margin-bottom: 17pt;\"><span style=\"font-size: 11.5pt; font-family: Verdana; color: rgb(68, 68, 68); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Real estate has always been a part of his life, as his father co-founded Century 21 Park Road almost 40 years ago.&nbsp;Since joining the brokerage in 2011, Mark has helped hundreds of clients purchase or sell a home. His devotion and unparalleled customer service has resulted in a continuously expanding network of loyal clients and referrals. In real estate, Mark is committed to staying ahead of the game when it comes to market education, trends, and technology. Buyers and sellers alike will say that he is connected, straight forward and dedicated to providing the very best service.</span></p><p dir=\"ltr\" style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255); line-height: 1.8; margin-top: 0pt; margin-bottom: 17pt;\"><span style=\"font-size: 11.5pt; font-family: Verdana; color: rgb(68, 68, 68); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Mark also enjoys working within the greater Reading-Berks community, co-chairing an event with the Reading Public Library in their fundraising efforts. His involvement in community service also includes Alvernia's Leadership Berks program, the Greater Reading Young Professionals Group, and more recently participating in the Olivet's Boys and Girls Club fundraising campaign. Another important aspect of his career is his involvement in relocation services, specifically with physicians coming into the Berks County area for the first time. Mark's mission has and will always be to provide a positive home buying or selling experience to his clients.</span></p>"
